import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav>
      <button><Link to="/">About</Link></button>
      <button><Link to="/challenges">Challenges</Link></button>
      <button><Link to="/solutions">Solutions</Link></button>
      <button><Link to="/future-scope">Future Scope</Link></button>
      <button><Link to="/explore-more">Explore More</Link></button>
    </nav>
  );
};

export default Navbar;
